import "../css/Email.css"

function Email() {
    const myEmail = "vaibhavilokegaonkar@gmail.com";
    return (
        <div className = "email" >
            <Link
            to='#'
            onClick={(e) => {
                window.location = `mailto:${myEmail}`;
                e.preventDefault();
            }}
            >{myEmail}</Link>
            {/* <a href = {`mailto(${myEmail})`}></a> */}
        </div>
    )
}

export default Email
